contracts/CircuitVersionManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./DeFiScoreRegistry.sol";

/**
 * @title CircuitVersionManager
 * @notice Manages circuit version upgrades and governance
 * @dev Handles verifier rotation, version deprecation, and upgrade proposals
 * 
 * Architecture:
 * - Multi-signature governance for upgrades
 * - Gradual version deprecation (grace period)
 * - Emergency pause mechanism
 * - Backward compatibility tracking
 * 
 * Security:
 * - Requires multiple approvals for upgrades
 * - Time-locked version activation
 * - Prevents immediate version switches
 * - Maintains audit trail
 */
contract CircuitVersionManager {
    
    // ============================================================================
    // STATE VARIABLES
    // ============================================================================
    
    /// @notice Reference to DeFiScoreRegistry
    DeFiScoreRegistry public immutable registry;
    
    /// @notice Governance addresses (multi-sig)
    address[] public governors;
    
    /// @notice Required approvals for upgrade
    uint256 public requiredApprovals;
    
    /// @notice Timelock duration for version activation (48 hours)
    uint256 public constant TIMELOCK_DURATION = 48 hours;
    
    /// @notice Grace period for deprecated versions (30 days)
    uint256 public constant DEPRECATION_GRACE_PERIOD = 30 days;
    
    /// @notice Emergency pause status
    bool public paused;
    
    // ============================================================================
    // STRUCTS
    // ============================================================================
    
    struct VersionInfo {
        uint256 versionId;
        address verifier;
        uint256 activationTime;
        uint256 deprecationTime;
        bool isActive;
        bool isDeprecated;
        string metadata; // IPFS hash or description
    }
    
    struct UpgradeProposal {
        uint256 proposalId;
        uint256 newVersion;
        address newVerifier;
        string metadata;
        uint256 proposedAt;
        uint256 activationTime;
        uint256 approvalCount;
        bool executed;
        mapping(address => bool) approvals;
    }
    
    // ============================================================================
    // STORAGE
    // ============================================================================
    
    /// @notice Version ID => Version info
    mapping(uint256 => VersionInfo) public versions;
    
    /// @notice Proposal ID => Upgrade proposal
    mapping(uint256 => UpgradeProposal) public proposals;
    
    /// @notice Next proposal ID
    uint256 public nextProposalId;
    
    /// @notice List of all version IDs
    uint256[] public versionList;
    
    // ============================================================================
    // EVENTS
    // ============================================================================
    
    event ProposalCreated(
        uint256 indexed proposalId,
        uint256 indexed newVersion,
        address indexed newVerifier,
        address proposer
    );
    
    event ProposalApproved(
        uint256 indexed proposalId,
        address indexed governor,
        uint256 approvalCount
    );
    
    event ProposalExecuted(
        uint256 indexed proposalId,
        uint256 indexed newVersion,
        address indexed newVerifier
    );
    
    event VersionActivated(
        uint256 indexed versionId,
        address indexed verifier
    );
    
    event VersionDeprecated(
        uint256 indexed versionId,
        uint256 deprecationTime
    );
    
    event GovernorAdded(address indexed governor);
    event GovernorRemoved(address indexed governor);
    event PauseToggled(bool paused);
    
    // ============================================================================
    // ERRORS
    // ============================================================================
    
    error Unauthorized();
    error InvalidVersion();
    error InvalidVerifier();
    error ProposalNotReady();
    error ProposalAlreadyExecuted();
    error AlreadyApproved();
    error SystemPaused();
    error InvalidGovernor();
    error InsufficientApprovals();
    
    // ============================================================================
    // MODIFIERS
    // ============================================================================
    
    modifier onlyGovernor() {
        bool isGov = false;
        for (uint256 i = 0; i < governors.length; i++) {
            if (governors[i] == msg.sender) {
                isGov = true;
                break;
            }
        }
        if (!isGov) revert Unauthorized();
        _;
    }
    
    modifier whenNotPaused() {
        if (paused) revert SystemPaused();
        _;
    }
    
    // ============================================================================
    // CONSTRUCTOR
    // ============================================================================
    
    constructor(
        address _registry,
        address[] memory _governors,
        uint256 _requiredApprovals
    ) {
        require(_registry != address(0), "Invalid registry");
        require(_governors.length >= _requiredApprovals, "Invalid approval count");
        require(_requiredApprovals > 0, "Must require at least 1 approval");
        
        registry = DeFiScoreRegistry(_registry);
        governors = _governors;
        requiredApprovals = _requiredApprovals;
        
        // Register initial version
        uint256 currentVersion = registry.currentVersion();
        address currentVerifier = registry.getVerifier(currentVersion);
        
        if (currentVerifier != address(0)) {
            versions[currentVersion] = VersionInfo({
                versionId: currentVersion,
                verifier: currentVerifier,
                activationTime: block.timestamp,
                deprecationTime: 0,
                isActive: true,
                isDeprecated: false,
                metadata: "Initial version"
            });
            versionList.push(currentVersion);
        }
    }
    
    // ============================================================================
    // GOVERNANCE FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Propose new circuit version
     * @param _newVersion Version ID
     * @param _newVerifier Verifier contract address
     * @param _metadata IPFS hash or description
     */
    function proposeUpgrade(
        uint256 _newVersion,
        address _newVerifier,
        string calldata _metadata
    ) external onlyGovernor whenNotPaused returns (uint256) {
        if (_newVerifier == address(0)) revert InvalidVerifier();
        if (versions[_newVersion].verifier != address(0)) revert InvalidVersion();
        
        uint256 proposalId = nextProposalId++;
        UpgradeProposal storage proposal = proposals[proposalId];
        
        proposal.proposalId = proposalId;
        proposal.newVersion = _newVersion;
        proposal.newVerifier = _newVerifier;
        proposal.metadata = _metadata;
        proposal.proposedAt = block.timestamp;
        proposal.activationTime = block.timestamp + TIMELOCK_DURATION;
        proposal.approvalCount = 1;
        proposal.executed = false;
        proposal.approvals[msg.sender] = true;
        
        emit ProposalCreated(proposalId, _newVersion, _newVerifier, msg.sender);
        emit ProposalApproved(proposalId, msg.sender, 1);
        
        return proposalId;
    }
    
    /**
     * @notice Approve upgrade proposal
     * @param _proposalId Proposal ID
     */
    function approveProposal(uint256 _proposalId) external onlyGovernor whenNotPaused {
        UpgradeProposal storage proposal = proposals[_proposalId];
        
        if (proposal.executed) revert ProposalAlreadyExecuted();
        if (proposal.approvals[msg.sender]) revert AlreadyApproved();
        
        proposal.approvals[msg.sender] = true;
        proposal.approvalCount++;
        
        emit ProposalApproved(_proposalId, msg.sender, proposal.approvalCount);
    }
    
    /**
     * @notice Execute approved proposal after timelock
     * @param _proposalId Proposal ID
     */
    function executeProposal(uint256 _proposalId) external onlyGovernor whenNotPaused {
        UpgradeProposal storage proposal = proposals[_proposalId];
        
        if (proposal.executed) revert ProposalAlreadyExecuted();
        if (proposal.approvalCount < requiredApprovals) revert InsufficientApprovals();
        if (block.timestamp < proposal.activationTime) revert ProposalNotReady();
        
        proposal.executed = true;
        
        // Add verifier to registry
        registry.addVerifier(proposal.newVersion, proposal.newVerifier);
        
        // Register version info
        versions[proposal.newVersion] = VersionInfo({
            versionId: proposal.newVersion,
            verifier: proposal.newVerifier,
            activationTime: block.timestamp,
            deprecationTime: 0,
            isActive: true,
            isDeprecated: false,
            metadata: proposal.metadata
        });
        versionList.push(proposal.newVersion);
        
        // Update current version in registry
        registry.setCurrentVersion(proposal.newVersion);
        
        emit ProposalExecuted(_proposalId, proposal.newVersion, proposal.newVerifier);
        emit VersionActivated(proposal.newVersion, proposal.newVerifier);
    }
    
    /**
     * @notice Deprecate old version (starts grace period)
     * @param _versionId Version to deprecate
     */
    function deprecateVersion(uint256 _versionId) external onlyGovernor {
        VersionInfo storage version = versions[_versionId];
        
        if (version.verifier == address(0)) revert InvalidVersion();
        if (version.isDeprecated) revert InvalidVersion();
        if (_versionId == registry.currentVersion()) revert InvalidVersion();
        
        version.isDeprecated = true;
        version.deprecationTime = block.timestamp + DEPRECATION_GRACE_PERIOD;
        
        emit VersionDeprecated(_versionId, version.deprecationTime);
    }
    
    /**
     * @notice Emergency pause system
     */
    function togglePause() external onlyGovernor {
        paused = !paused;
        emit PauseToggled(paused);
    }
    
    /**
     * @notice Add new governor
     * @param _governor Governor address
     */
    function addGovernor(address _governor) external onlyGovernor {
        if (_governor == address(0)) revert InvalidGovernor();
        
        for (uint256 i = 0; i < governors.length; i++) {
            if (governors[i] == _governor) revert InvalidGovernor();
        }
        
        governors.push(_governor);
        emit GovernorAdded(_governor);
    }
    
    /**
     * @notice Remove governor
     * @param _governor Governor address
     */
    function removeGovernor(address _governor) external onlyGovernor {
        require(governors.length > requiredApprovals, "Cannot remove governor");
        
        for (uint256 i = 0; i < governors.length; i++) {
            if (governors[i] == _governor) {
                governors[i] = governors[governors.length - 1];
                governors.pop();
                emit GovernorRemoved(_governor);
                return;
            }
        }
        
        revert InvalidGovernor();
    }
    
    // ============================================================================
    // VIEW FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Get version info
     * @param _versionId Version ID
     */
    function getVersionInfo(uint256 _versionId) external view returns (VersionInfo memory) {
        return versions[_versionId];
    }
    
    /**
     * @notice Get all versions
     */
    function getAllVersions() external view returns (uint256[] memory) {
        return versionList;
    }
    
    /**
     * @notice Check if version is valid for use
     * @param _versionId Version ID
     */
    function isVersionValid(uint256 _versionId) external view returns (bool) {
        VersionInfo memory version = versions[_versionId];
        
        if (!version.isActive) return false;
        if (version.isDeprecated && block.timestamp > version.deprecationTime) return false;
        
        return true;
    }
    
    /**
     * @notice Get proposal details
     * @param _proposalId Proposal ID
     */
    function getProposal(uint256 _proposalId) external view returns (
        uint256 newVersion,
        address newVerifier,
        string memory metadata,
        uint256 proposedAt,
        uint256 activationTime,
        uint256 approvalCount,
        bool executed
    ) {
        UpgradeProposal storage proposal = proposals[_proposalId];
        return (
            proposal.newVersion,
            proposal.newVerifier,
            proposal.metadata,
            proposal.proposedAt,
            proposal.activationTime,
            proposal.approvalCount,
            proposal.executed
        );
    }
    
    /**
     * @notice Check if address is governor
     * @param _address Address to check
     */
    function isGovernor(address _address) external view returns (bool) {
        for (uint256 i = 0; i < governors.length; i++) {
            if (governors[i] == _address) return true;
        }
        return false;
    }
    
    /**
     * @notice Get all governors
     */
    function getGovernors() external view returns (address[] memory) {
        return governors;
    }
}

contracts/DeFiScoreRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title DeFi Score Registry
 * @notice Registry for ZK-proven credit score eligibility
 * @dev Stores eligibility status, manages nullifiers, enforces validity periods
 * 
 * Architecture:
 * - Per-lender threshold configuration
 * - 24-hour proof validity window
 * - Replay protection via nullifier tracking
 * - Circuit version management
 * - Upgradeable verifier system
 * 
 * Security:
 * - Nullifier prevents proof reuse
 * - Timestamp enforces freshness
 * - Version control prevents cross-version attacks
 * - Owner-controlled verifier updates
 */

interface IVerifier {
    function verifyProof(
        uint[2] calldata _pA,
        uint[2][2] calldata _pB,
        uint[2] calldata _pC,
        uint[11] calldata _pubSignals
    ) external view returns (bool);
}

contract DeFiScoreRegistry {
    
    // ============================================================================
    // STATE VARIABLES
    // ============================================================================
    
    /// @notice Contract owner (can update verifiers)
    address public owner;
    
    /// @notice Current circuit version
    uint256 public currentVersion;
    
    /// @notice Proof validity duration (24 hours)
    uint256 public constant PROOF_VALIDITY_DURATION = 24 hours;
    
    /// @notice Maximum allowed timestamp drift (5 minutes)
    uint256 public constant MAX_TIMESTAMP_DRIFT = 5 minutes;
    
    /// @notice Mapping: version => verifier contract
    mapping(uint256 => address) public verifiers;
    
    /// @notice Mapping: nullifier => used status
    mapping(bytes32 => bool) public usedNullifiers;
    
    /// @notice Mapping: user => eligibility data
    mapping(address => EligibilityData) public eligibility;
    
    /// @notice Mapping: lender => threshold
    mapping(address => uint256) public lenderThresholds;
    
    // ============================================================================
    // STRUCTS
    // ============================================================================
    
    struct EligibilityData {
        uint256 score;              // Credit score (scaled x1000)
        uint256 timestamp;          // Proof submission time
        bytes32 nullifier;          // Proof nullifier
        uint256 version;            // Circuit version
        bool isEligible;            // Eligibility status
    }
    
    // ============================================================================
    // EVENTS
    // ============================================================================
    
    event ProofSubmitted(
        address indexed user,
        uint256 score,
        uint256 timestamp,
        bytes32 nullifier,
        uint256 version
    );
    
    event VerifierUpdated(
        uint256 indexed version,
        address indexed verifier
    );
    
    event ThresholdUpdated(
        address indexed lender,
        uint256 threshold
    );
    
    event OwnershipTransferred(
        address indexed previousOwner,
        address indexed newOwner
    );
    
    // ============================================================================
    // ERRORS
    // ============================================================================
    
    error Unauthorized();
    error InvalidProof();
    error NullifierAlreadyUsed();
    error InvalidTimestamp();
    error InvalidVersion();
    error InvalidVerifier();
    error InvalidThreshold();
    error ProofExpired();
    
    // ============================================================================
    // MODIFIERS
    // ============================================================================
    
    modifier onlyOwner() {
        if (msg.sender != owner) revert Unauthorized();
        _;
    }
    
    // ============================================================================
    // CONSTRUCTOR
    // ============================================================================
    
    constructor(address _initialVerifier) {
        owner = msg.sender;
        currentVersion = 1;
        verifiers[1] = _initialVerifier;
        
        emit VerifierUpdated(1, _initialVerifier);
    }
    
    // ============================================================================
    // CORE FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Submit ZK proof of credit score eligibility
     * @param _proof Groth16 proof components [pA, pB, pC]
     * @param _pubSignals Public signals (11 elements)
     * 
     * Public Signals:
     *   [0] userAddress
     *   [1] scoreTotal
     *   [2] scoreRepayment
     *   [3] scoreCapital
     *   [4] scoreLongevity
     *   [5] scoreActivity
     *   [6] scoreProtocol
     *   [7] threshold
     *   [8] timestamp
     *   [9] nullifier
     *   [10] versionId
     * 
     * NOTE: Anyone can submit a proof for any user (proof itself proves authenticity)
     */
    function submitProof(
        uint[8] calldata _proof,
        uint[11] calldata _pubSignals
    ) external {
        // Extract public signals
        address user = address(uint160(_pubSignals[0]));
        uint256 score = _pubSignals[1];
        uint256 timestamp = _pubSignals[8];
        bytes32 nullifier = bytes32(_pubSignals[9]);
        uint256 version = _pubSignals[10];
        
        // Validation 1: Check nullifier not used
        if (usedNullifiers[nullifier]) revert NullifierAlreadyUsed();
        
        // Validation 2: Check timestamp validity
        if (timestamp > block.timestamp + MAX_TIMESTAMP_DRIFT) {
            revert InvalidTimestamp();
        }
        if (block.timestamp > timestamp + PROOF_VALIDITY_DURATION) {
            revert ProofExpired();
        }
        
        // Validation 3: Check version exists
        address verifier = verifiers[version];
        if (verifier == address(0)) revert InvalidVersion();
        
        // Validation 4: Verify proof
        bool isValid = IVerifier(verifier).verifyProof(
            [_proof[0], _proof[1]],
            [[_proof[2], _proof[3]], [_proof[4], _proof[5]]],
            [_proof[6], _proof[7]],
            _pubSignals
        );
        
        if (!isValid) revert InvalidProof();
        
        // Mark nullifier as used
        usedNullifiers[nullifier] = true;
        
        // Store eligibility data
        eligibility[user] = EligibilityData({
            score: score,
            timestamp: timestamp,
            nullifier: nullifier,
            version: version,
            isEligible: true
        });
        
        emit ProofSubmitted(user, score, timestamp, nullifier, version);
    }
    
    /**
     * @notice Check if user is eligible (has valid proof)
     * @param _user User address to check
     * @return bool Eligibility status
     */
    function isEligible(address _user) external view returns (bool) {
        EligibilityData memory data = eligibility[_user];
        
        if (!data.isEligible) return false;
        
        // Check if proof is still valid (within 24 hours)
        if (block.timestamp > data.timestamp + PROOF_VALIDITY_DURATION) {
            return false;
        }
        
        return true;
    }
    
    /**
     * @notice Check if user meets specific threshold
     * @param _user User address to check
     * @param _threshold Minimum score required (scaled x1000)
     * @return bool Whether user meets threshold
     */
    function meetsThreshold(address _user, uint256 _threshold) external view returns (bool) {
        EligibilityData memory data = eligibility[_user];
        
        if (!data.isEligible) return false;
        
        // Check if proof is still valid
        if (block.timestamp > data.timestamp + PROOF_VALIDITY_DURATION) {
            return false;
        }
        
        // Check if score meets threshold
        return data.score >= _threshold;
    }
    
    /**
     * @notice Get user's eligibility data
     * @param _user User address
     * @return EligibilityData struct
     */
    function getEligibilityData(address _user) external view returns (EligibilityData memory) {
        return eligibility[_user];
    }
    
    /**
     * @notice Check if proof is still fresh (within validity window)
     * @param _user User address
     * @return bool Freshness status
     */
    function isProofFresh(address _user) external view returns (bool) {
        EligibilityData memory data = eligibility[_user];
        
        if (!data.isEligible) return false;
        
        return block.timestamp <= data.timestamp + PROOF_VALIDITY_DURATION;
    }
    
    /**
     * @notice Get time remaining until proof expires
     * @param _user User address
     * @return uint256 Seconds remaining (0 if expired)
     */
    function getTimeUntilExpiry(address _user) external view returns (uint256) {
        EligibilityData memory data = eligibility[_user];
        
        if (!data.isEligible) return 0;
        
        uint256 expiryTime = data.timestamp + PROOF_VALIDITY_DURATION;
        
        if (block.timestamp >= expiryTime) return 0;
        
        return expiryTime - block.timestamp;
    }
    
    // ============================================================================
    // LENDER FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Set threshold for lender
     * @param _threshold Minimum score required (scaled x1000, 0-900000)
     */
    function setThreshold(uint256 _threshold) external {
        if (_threshold > 900000) revert InvalidThreshold();
        
        lenderThresholds[msg.sender] = _threshold;
        
        emit ThresholdUpdated(msg.sender, _threshold);
    }
    
    /**
     * @notice Check if user meets lender's threshold
     * @param _user User address
     * @param _lender Lender address
     * @return bool Whether user meets lender's threshold
     */
    function meetsLenderThreshold(address _user, address _lender) external view returns (bool) {
        uint256 threshold = lenderThresholds[_lender];
        
        if (threshold == 0) return false; // Lender hasn't set threshold
        
        EligibilityData memory data = eligibility[_user];
        
        if (!data.isEligible) return false;
        
        // Check if proof is still valid
        if (block.timestamp > data.timestamp + PROOF_VALIDITY_DURATION) {
            return false;
        }
        
        // Check if score meets threshold
        return data.score >= threshold;
    }
    
    /**
     * @notice Get lender's threshold
     * @param _lender Lender address
     * @return uint256 Threshold (0 if not set)
     */
    function getLenderThreshold(address _lender) external view returns (uint256) {
        return lenderThresholds[_lender];
    }
    
    // ============================================================================
    // ADMIN FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Add new verifier for circuit version
     * @param _version Circuit version
     * @param _verifier Verifier contract address
     */
    function addVerifier(uint256 _version, address _verifier) external onlyOwner {
        if (_verifier == address(0)) revert InvalidVerifier();
        
        verifiers[_version] = _verifier;
        
        emit VerifierUpdated(_version, _verifier);
    }
    
    /**
     * @notice Update current version
     * @param _version New current version
     */
    function setCurrentVersion(uint256 _version) external onlyOwner {
        if (verifiers[_version] == address(0)) revert InvalidVersion();
        
        currentVersion = _version;
    }
    
    /**
     * @notice Transfer ownership
     * @param _newOwner New owner address
     */
    function transferOwnership(address _newOwner) external onlyOwner {
        if (_newOwner == address(0)) revert Unauthorized();
        
        address oldOwner = owner;
        owner = _newOwner;
        
        emit OwnershipTransferred(oldOwner, _newOwner);
    }
    
    // ============================================================================
    // VIEW FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Get verifier for specific version
     * @param _version Circuit version
     * @return address Verifier contract address
     */
    function getVerifier(uint256 _version) external view returns (address) {
        return verifiers[_version];
    }
    
    /**
     * @notice Check if nullifier has been used
     * @param _nullifier Nullifier hash
     * @return bool Usage status
     */
    function isNullifierUsed(bytes32 _nullifier) external view returns (bool) {
        return usedNullifiers[_nullifier];
    }
}

contracts/LenderIntegration.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./DeFiScoreRegistry.sol";

/**
 * @title LenderIntegration
 * @notice Example lender contract integrating DeFi credit scores
 * @dev Demonstrates how lending protocols can use the score registry
 * 
 * Features:
 * - Per-lender threshold configuration
 * - Automatic credit score verification
 * - Borrow limit management
 * - Proof freshness enforcement
 * 
 * Integration Pattern:
 * 1. Lender sets threshold via setThreshold()
 * 2. User submits ZK proof to DeFiScoreRegistry
 * 3. User calls borrow() - automatic eligibility check
 * 4. Lender can query eligibility anytime via checkEligibility()
 */
contract LenderIntegration {
    
    // ============================================================================
    // STATE VARIABLES
    // ============================================================================
    
    /// @notice Reference to DeFiScoreRegistry
    DeFiScoreRegistry public immutable scoreRegistry;
    
    /// @notice Minimum credit score required for borrowing (scaled x1000)
    uint256 public borrowThreshold;
    
    /// @notice Contract owner
    address public owner;
    
    /// @notice Mapping of user to borrow limit (in wei)
    mapping(address => uint256) public borrowLimits;
    
    /// @notice Mapping of user to current borrowed amount
    mapping(address => uint256) public borrowed;
    
    // ============================================================================
    // EVENTS
    // ============================================================================
    
    event ThresholdUpdated(uint256 oldThreshold, uint256 newThreshold);
    event BorrowLimitSet(address indexed user, uint256 limit);
    event Borrowed(address indexed user, uint256 amount);
    event Repaid(address indexed user, uint256 amount);
    
    // ============================================================================
    // ERRORS
    // ============================================================================
    
    error Unauthorized();
    error InsufficientCreditScore(uint256 required, uint256 actual);
    error CreditScoreExpired();
    error NoCreditScore();
    error ExceedsBorrowLimit();
    error NothingToBorrow();
    error NothingToRepay();
    
    // ============================================================================
    // MODIFIERS
    // ============================================================================
    
    modifier onlyOwner() {
        if (msg.sender != owner) revert Unauthorized();
        _;
    }
    
    // ============================================================================
    // CONSTRUCTOR
    // ============================================================================
    
    /**
     * @param _scoreRegistry Address of DeFiScoreRegistry
     * @param _initialThreshold Initial credit score threshold
     */
    constructor(address _scoreRegistry, uint256 _initialThreshold) {
        scoreRegistry = DeFiScoreRegistry(_scoreRegistry);
        borrowThreshold = _initialThreshold;
        owner = msg.sender;
    }
    
    // ============================================================================
    // BORROWING FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Borrow funds (requires valid credit score)
     * @param amount Amount to borrow
     */
    function borrow(uint256 amount) external {
        if (amount == 0) revert NothingToBorrow();
        
        // Check credit score eligibility
        _checkCreditScore(msg.sender);
        
        // Check borrow limit
        uint256 limit = borrowLimits[msg.sender];
        uint256 currentBorrowed = borrowed[msg.sender];
        
        if (currentBorrowed + amount > limit) {
            revert ExceedsBorrowLimit();
        }
        
        // Update borrowed amount
        borrowed[msg.sender] = currentBorrowed + amount;
        
        // Transfer funds (simplified - in production, use proper lending logic)
        payable(msg.sender).transfer(amount);
        
        emit Borrowed(msg.sender, amount);
    }
    
    /**
     * @notice Repay borrowed funds
     */
    function repay() external payable {
        if (msg.value == 0) revert NothingToRepay();
        
        uint256 currentBorrowed = borrowed[msg.sender];
        
        if (currentBorrowed == 0) revert NothingToRepay();
        
        // Update borrowed amount
        if (msg.value >= currentBorrowed) {
            borrowed[msg.sender] = 0;
            
            // Refund excess
            if (msg.value > currentBorrowed) {
                payable(msg.sender).transfer(msg.value - currentBorrowed);
            }
        } else {
            borrowed[msg.sender] = currentBorrowed - msg.value;
        }
        
        emit Repaid(msg.sender, msg.value);
    }
    
    /**
     * @notice Check if user is eligible to borrow
     * @param user User address
     * @return eligible True if user meets credit requirements
     * @return score User's credit score (scaled x1000)
     * @return availableLimit Remaining borrow capacity
     */
    function checkEligibility(address user) 
        external 
        view 
        returns (
            bool eligible,
            uint256 score,
            uint256 availableLimit
        ) 
    {
        // Check if user meets this lender's threshold
        bool meetsThreshold = scoreRegistry.meetsLenderThreshold(user, address(this));
        
        if (!meetsThreshold) {
            // Get score for informational purposes
            DeFiScoreRegistry.EligibilityData memory eligData = scoreRegistry.getEligibilityData(user);
            return (false, eligData.score, 0);
        }
        
        // Get user's score
        DeFiScoreRegistry.EligibilityData memory data = scoreRegistry.getEligibilityData(user);
        
        // Calculate available limit
        uint256 limit = borrowLimits[user];
        uint256 currentBorrowed = borrowed[user];
        uint256 available = limit > currentBorrowed ? limit - currentBorrowed : 0;
        
        return (true, data.score, available);
    }
    
    // ============================================================================
    // ADMIN FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Update credit score threshold
     * @param newThreshold New minimum score (scaled x1000, 0-900000)
     */
    function setThreshold(uint256 newThreshold) external onlyOwner {
        require(newThreshold <= 900000, "Invalid threshold");
        
        uint256 oldThreshold = borrowThreshold;
        borrowThreshold = newThreshold;
        
        // Also update in registry for this lender
        scoreRegistry.setThreshold(newThreshold);
        
        emit ThresholdUpdated(oldThreshold, newThreshold);
    }
    
    /**
     * @notice Set borrow limit for user
     * @param user User address
     * @param limit Borrow limit in wei
     */
    function setBorrowLimit(address user, uint256 limit) external onlyOwner {
        borrowLimits[user] = limit;
        
        emit BorrowLimitSet(user, limit);
    }
    
    /**
     * @notice Batch set borrow limits
     * @param users Array of user addresses
     * @param limits Array of borrow limits
     */
    function setBorrowLimitsBatch(
        address[] calldata users,
        uint256[] calldata limits
    ) external onlyOwner {
        require(users.length == limits.length, "Length mismatch");
        
        for (uint256 i = 0; i < users.length; i++) {
            borrowLimits[users[i]] = limits[i];
            emit BorrowLimitSet(users[i], limits[i]);
        }
    }
    
    /**
     * @notice Withdraw contract balance (owner only)
     */
    function withdraw() external onlyOwner {
        payable(owner).transfer(address(this).balance);
    }
    
    /**
     * @notice Deposit funds to contract
     */
    receive() external payable {}
    
    // ============================================================================
    // INTERNAL FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Internal function to check credit score
     * @param user User address
     */
    function _checkCreditScore(address user) internal view {
        // Check if user meets this lender's threshold
        bool meetsThreshold = scoreRegistry.meetsLenderThreshold(user, address(this));
        
        if (!meetsThreshold) {
            // Get detailed data for error message
            DeFiScoreRegistry.EligibilityData memory data = scoreRegistry.getEligibilityData(user);
            
            if (!data.isEligible) {
                revert NoCreditScore();
            }
            
            // Check if proof expired
            if (!scoreRegistry.isProofFresh(user)) {
                revert CreditScoreExpired();
            }
            
            // Score exists but doesn't meet threshold
            revert InsufficientCreditScore(borrowThreshold, data.score);
        }
    }
    
    /**
     * @notice Get time until user's proof expires
     * @param user User address
     * @return uint256 Seconds until expiry (0 if expired)
     */
    function getTimeUntilExpiry(address user) external view returns (uint256) {
        return scoreRegistry.getTimeUntilExpiry(user);
    }
    
    /**
     * @notice Check if user's proof is still fresh
     * @param user User address
     * @return bool Freshness status
     */
    function isProofFresh(address user) external view returns (bool) {
        return scoreRegistry.isProofFresh(user);
    }
}

